package com.example.practica_recycle_view;

import androidx.appcompat.app.AppCompatActivity;
import androidx.recyclerview.widget.LinearLayoutManager;
import androidx.recyclerview.widget.RecyclerView;

import android.os.Bundle;

import com.example.practica_recycle_view.Models.Adapters.CarrosAdapter;
import com.example.practica_recycle_view.Models.Carros;

import java.util.ArrayList;
import java.util.List;

public class Lista_Carros extends AppCompatActivity {

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_lista_carros);

        List<Carros> carro=new ArrayList<>();
        carro.add(new Carros("Toyota",20000,35000.00,"data:image/jpeg;base64,"));
        carro.add(new Carros("Nissan",100,100000.00,"data:image/jpeg;base64,"));
        carro.add(new Carros("Chevrolet",646478,51322.555,"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR4G-P0brERKdE73lMAM3kCiHPush_H6p7obQ&usqp=CAU"));
        carro.add(new Carros("Ford",320012,667566.274,"data:image/jpeg;base64,"));
        carro.add(new Carros("BMW",172074,953891.449,"data:image/jpeg;base64,"));

        CarrosAdapter carros=new CarrosAdapter(carro);
        RecyclerView rv=findViewById(R.id.lisCarros);
        rv.setAdapter(carros);
        rv.setLayoutManager(new LinearLayoutManager(this));
        rv.setHasFixedSize(true);
    }
}